import { ListGroupItem as Item, Image } from "react-bootstrap";
import "./userCard.css";

export default function UserCard({ member }) {
  return (
    <Item>
      <Image
        src={member.picture}
        roundedCircle
        fluid
        className="profilePicture"
      />
      <h4>{member.name}</h4>
    </Item>
  );
}
